import React from 'react';
import ReactContactForm from 'react-mail-form';
import makeStyles from "@material-ui/core/styles/makeStyles";
import TextField from "@material-ui/core/TextField";
import DP from "./images/Home/DP.jpg"
import InfoCard from "./utlilty/InfoCard";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles(theme => ({
    contact: {
        minWidth: 1000,
        minHeight: 1000,
    },
    dp: {
        width: "100%",
        height: "100%",
        borderRadius: 50,
    },
    home: {
        padding: 20,
    },
    bio: {
        maxWidth: 200,
        width: 200,
        height: 500,
    }
}));

export default function HomePage() {
    const classes = useStyles();
    return (
        <Grid container spacing={7} direction="row-reverse" justify="center" className={classes.home}>
            <Grid item xs={7}>
                <InfoCard title="Bio" className={classes.bio}>
                    Hello
                </InfoCard>
            </Grid>
            <Grid item xs={4}>
                <img className={classes.dp} src={DP} alt="Display pic"/>
            </Grid>
        </Grid>
    );
}
